import React from 'react';
import list from '../styles/List.module.css';

const Favorites = ({ items }) => {
  return (
    <main className={list['wrapper--favorites']}>
      {items.length && items.map(item => (
        <article className={list.favorite}>
          <p>{item.day}</p>

          <p>{item.description}</p>

          <p>{item.duration}</p>

          <p>{item.frequency}</p>

          <p>{item.max_members}</p>

          <p>{item.members}</p>

          <p>{item.title}</p>
        </article>
      ))
      }
    </main>
  )
}

export default Favorites;
